import React from 'react'
import {Link,NavLink} from 'react-router-dom'
var loginCSS= require('./login.css')

export default class LoginPage extends React.Component{
    render(){
        return(
            <div className={loginCSS.login}>
                <div>
            <h3>用户名</h3></div>

            <br></br>
            <div>
            <p>密码</p>
            </div>
            <button>登录</button>
            </div>
        )
    }
}
